import {ADD_FILE} from "./actionTypes";

const initialState = {
    file: null
};

export default function importReducer(state = initialState, action) {

    switch (action.type) {

        case ADD_FILE:
            console.log(action.file)
            return {
                ...state,
                file: action.file
            }
        default: return state;
    }
}
